CREATE TABLE IF NOT EXISTS Rumah123_Housing_Data (
    `property_title` VARCHAR(245) CHARACTER SET utf8,
    `property_agent` VARCHAR(33) CHARACTER SET utf8,
    `location` VARCHAR(45) CHARACTER SET utf8,
    `latitude` NUMERIC(18, 16),
    `longitude` NUMERIC(17, 14),
    `phone_number` NUMERIC(19, 4),
    `property_type` VARCHAR(5) CHARACTER SET utf8,
    `land_area` INT,
    `building_area` INT,
    `price_idr` NUMERIC(13, 1),
    `num_bathroom` INT,
    `num_bedroom` INT,
    `garage_capacity` INT
);
